import React, { Component } from 'react';

class LoginForm extends Component {

  handleLogin(val) {
    alert(val);

  }
  render() {
    return (
      <form>
        <label for="nya">Identificacion</label>
        <br />
        <input type="text" name="nya" id="nya" required onChange={this.handleIdChange}/>
        <br /><br />
        <label for="email">Password</label>
        <br />
        <input type="text" name="email" id="email" required onChange={this.handlePasswordChange}/> 
        <br />
        <button className="btn" onClick={this.handleLogin}>Entrar</button>
      </form>
    );
  }
}

export default LoginForm
